import Vue from 'vue';
import {Button,Input,Container} from 'element-ui';
import 'element-ui/lib/theme-chalk/index.css';
import App from './App.vue';
import router from '../router'
Vue.use(Button);
Vue.use(Input);
Vue.use(Container);

new Vue({
  router,
  el: '#app',
  render: h => h(App)
});
